#Problem 11

dna = ""

reversedna = dna[::-1]
compliment = ""

for i in reversedna:
    if i == "A":
        compliment += "T"
    elif i == "T":
        compliment += "A"
    elif i == "G":
        compliment += "C"
    else:
        compliment += "G"


print(compliment)